import React from 'react';


export  class Eview extends React.Component<any> {
    render(){
        return(
            <>
            <div key={this.props.id} className="col">
            <span key={this.props.random} >id:  {this.props.id}</span>  
          <span key={this.props.random} >username:  {this.props.username}</span>  
          <span key={this.props.random} >password:  {this.props.pass}</span>  
          <span key={this.props.random} >firstname: {this.props.firstname}</span>  
          <span key={this.props.random} >lastname: {this.props.lastname}</span>  
          <span key={this.props.random} >email: {this.props.email}</span>  
          <span key={this.props.random} >role: {this.props.role}</span>  
          </div>
            </>
        )
    }
}
